var steveSpeachAudio= document.getElementById("steveSpeach");
var keyboardTypeAudio= document.getElementById("keyboardType");
var lineCounter=0;
var officeSound= new Audio("officeSound.wav");
officeSound.loop=true;
officeSound.volume=0.5
$(document).ready(function(){
	officeSound.play();

});
var currentPic=0;

setText = function(index){
	lineCounter++;
	speed= (imageList[currentPic+1][1]-imageList[currentPic][1])*1000/acsiiPics[imageList[index][0]].length;
	if(steveSpeachAudio.currentTime>imageList[currentPic+1][1]-0.1){
		steveSpeachAudio.pause();
		keyboardTypeAudio.pause();
	}
	if(currentPic==0){
		lineCounter=0;
		return;
	}
	if(lineCounter>=acsiiPics[imageList[index][0]].length){
		currentPic=0;
		lineCounter=0;
	}
	$(document).scrollTop($(document).height());
	newText=acsiiPics[imageList[index][0]][lineCounter];

	newText = newText.split("@".repeat(12)).join("keep_looking");
	newText = newText.split("@".repeat(11)).join("dont_settle");
	newText = newText.split("@".repeat(9)).join("no_reason");
	newText = newText.split("@".repeat(7)).join("find_it");
	newText = newText.split("@".repeat(6)).join("change");
	newText = newText.split("@".repeat(4)).join("work");
    $("#textContainer").append("<p>> "+ newText+"</p>");
    
}


Mousetrap.bind("-", function(){
	
	if(parseInt($("#textContainer").css("font-size"))<=2){
		$("#textContainer").css("font-size", "2");
		return;
	}
	$("#textContainer").css("font-size", "-=2");

	
	
});
Mousetrap.bind("=", function(){
	
	$("#textContainer").css("font-size", "+=2");
	
});

whenKeyPressed=function(pic){
	currentPic=pic;
	steveSpeachAudio.currentTime= imageList[currentPic][1];
	steveSpeachAudio.play();
	lineCounter=0
	keyboardTypeAudio.currentTime=0;
	keyboardTypeAudio.play();
}
